import { IUniversity } from "..";

import './UniversitiesContainer.css';


interface IUniversitiesContainerProps {
    universities: IUniversity[];
    country: string
}

export function UniversitiesContainer({ universities } : IUniversitiesContainerProps) {
    return (
        <div className='universities-container'>
            <div className='universities-description'>
                There are {universities.length} universities in this country
            </div>
            <div className='universities-list'>
                {universities.map((uni, index) => {
                    return (
                        <div className="university-item" key={index}>
                            <a href={uni.domains[0]}>{uni.name}</a>
                        </div>
                    );
                })}
            </div>
        </div>
    );
}
